import {
  InfoWidgetContent,
  InfoWidgetTitle,
  InfoWidgetWrapper,
} from './InfoWidget.styles';

type InfoWidgetProps = {
  title: string;
  content?: React.ReactNode;
  styles?: string;
};

export const InfoWidget = ({ title, content, styles }: InfoWidgetProps) => {
  return (
    <InfoWidgetWrapper styles={styles}>
      <InfoWidgetTitle>{title}</InfoWidgetTitle>
      <InfoWidgetContent>{content}</InfoWidgetContent>
    </InfoWidgetWrapper>
  );
};
